import "./navbar.scss";
import React from "react";
import FilterButtons from "../../components/FilterButtons"
const Navbar = () => {
  return (
    <div className="navbar-container">
      <div className="first">
        <FilterButtons />
      </div>
      <div className="last"></div>
    </div>
  );
};

export default Navbar;
